import axios from "axios";
import React, { useState } from "react";
import { View, Text, TextInput, TouchableOpacity, StyleSheet, Keyboard, ScrollView} from "react-native";
import {Picker} from '@react-native-picker/picker';
import { StatusBar } from "expo-status-bar";

export default function CadastrarDoacao() {
  const [doador, setDoador] = useState("");
  const [tipo_doacao, setTipo] = useState("");
  const [descricao, setDescricao] = useState("");
  const [nomedoador, setNomedoador] = useState("");
  const [quantia, setQuantia] = useState("");

  async function cadastrarDados() {
    try {
      const res = await axios.get(
        //onde está "192.168.100.93" cooque seu ipv4
        "http://192.168.100.93/api_sgpApp/cadastrar_doacao.php?doador=" +
        doador +
        "&tipo_doacao=" +
        tipo_doacao +
        "&descricao=" +
        descricao +
        "&nomedoador=" +
        nomedoador +
        "&quantia=" +
        quantia
      );
      Keyboard.dismiss();
      alert("Cadastro realizado");
    } catch (error) {
      console.log("Erro: ", error);
    }

  }

  return (
    <ScrollView style={styles.container}>
      <StatusBar hidden={true}></StatusBar>

      <Text style={styles.titulo}>Cadastrar Doação</Text>


    <View style={styles.areaCad}>
      <View style={{ alignItems: "center" }}>
          <Text style={styles.text}>Digite o nome do doador</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite o nome do doador"
            value={doador}
            onChangeText={(texto) => setDoador(texto)}
          />
        </View>

        <View style={{ alignItems: "center" }}>
          <Text style={styles.text}>Digite o id do tipo de doação</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite o tipo de doação"
            value={tipo_doacao}
            onChangeText={(texto) => setTipo(texto)}
          />
        </View>

        <View style={{ alignItems: "center" }}>
          <Text style={styles.text}>Digite a descrição da doação</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite uma descrição"
            value={descricao}
            onChangeText={(texto) => setDescricao(texto)}
          />
        </View>

        <View style={{ alignItems: "center" }}>
          <Text style={styles.text}>Digite o nome do doador</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite o nome do doador"
            value={nomedoador}
            onChangeText={(texto) => setNomedoador(texto)}
          />
        </View>


        <View style={{ alignItems: "center", marginBottom: 30 }}>
          <Text style={styles.text}>Digite a quantidade da doação</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite a quantia doada"
            value={quantia}
            onChangeText={(texto) => setQuantia(texto)}
          />
        </View>  
        </View>

        <View style={styles.areaBtn}>
          <TouchableOpacity
            style={[styles.botao]}
            onPress={cadastrarDados}
          >
            <Text style={styles.botaoText}>Cadastrar</Text>
          </TouchableOpacity>
    </View>

    </ScrollView>
  );
}

//css
const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  titulo: {
    backgroundColor: "#4F7063",
    fontSize: 50,
    height: 80,
    textAlignVertical:'center',
  },
  areaCad:{
    borderRadius: 20,
    marginRight: 10,
    marginLeft: 10,
    marginTop: 30,
    marginBottom:15,
    backgroundColor: "#4F7063",
  },
  text: {
    marginTop: 25,
    marginBottom: 15,
    fontSize: 25,
    fontWeight: "bold",
  },
  input: {
    backgroundColor: "#FFF",
    borderWidth: 1,
    borderColor: "#DDD",
    borderRadius: 5,
    width: "90%",
    padding: 10,
    fontSize: 18,
  },
  areaBtn: {
    alignItems: "center",
    flexDirection: "row",
    marginBottom:15,
    justifyContent: "center",
  },
  botao: {
    backgroundColor: "#1d75cd",
    height:55,
    justifyContent: "center",
    alignItems: "center",
    padding: 15,
    borderRadius: 5,
  },
  botaoText: {
    fontSize: 22,
    color: "#FFF",
  },
  resultado: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  itemText: {
    fontSize: 22,
  },
  picker: {
    backgroundColor: "#FFF",
    borderWidth: 1,
    borderColor: "#DDD",
    borderRadius: 5,
    width: "90%",
    height: 50,
  },
});
